import React, { useState } from "react";

const Signin = () => {
  const [email, setEmail] = useState("");
  const [password, setpassword] = useState("");

  return (
    <form>
      <label for="email">email</label>
      <input
        value={email}
        type="email"
        placeholder="email"
        id="email"
        name="email"
      />
      <label for="password">email</label>
      <input
        value={password}
        type="password"
        placeholder="password"
        id="password"
        name="password"
      />
    </form>
  );
};

export default Signin;
